import { Link } from 'react-router-dom'

const Home = () => {
  return (
    <div>
      <h1>Attendance System</h1>
      <Link to="/teacher"><input type="button" value="Teacher" /></Link>
      <Link to="/student"><input type="button" value="Student" /></Link>
      
      
    </div>
  )
}

export default Home
